TArray<FVector> UCustomPathfindingLibrary::getPath(int sx, int sy, int gx, int gy, int z)
{
	int xPointer[h*w];
	int yPointer[h*w];
	float gPointer[h*w];
	bool checkedMap[h*w];
	std::priority_queue<MapLoc, std::vector<MapLoc>, std::greater<MapLoc> > q;
	MapLoc startLoc = MapLoc(sx, sy, 0.0, std::max(abs(sx - gx),abs(sy - gy)));
	q.push(startLoc);

	for (int i = 0; i < h*w; i++) {
		checkedMap[i] = false;
		xPointer[i] = 0;
		yPointer[i] = 0;
		gPointer[i] = 1e16;
	}

	bool found = false;
	globalFound = false;
	globalCost = 1e16;
	while (!q.empty()){
		MapLoc current = q.top();
		if (current.getX() == gx && current.getY() == gy) {
			found = true;
			globalFound = true;
			globalCost = current.getG();
			break;
		}
		checkedMap[current.getY() * w + current.getX()] = true;
		q.pop();

		for (int i = 0; i < 8; i++) {
			int nx = current.getX() + xOffset[i];
			int ny = current.getY() + yOffset[i];
			float nG = current.getG() + ncosts[i];
			int index = ny * w + nx;

			if (checkedMap[index] || fullMap[z-1][index] == 0 || gPointer[index] <= nG) {
				continue;
			}

			float nH = std::max(abs(nx - gx),abs(ny - gy));
			xPointer[index] = current.getX();
			yPointer[index] = current.getY();
			gPointer[index] = nG;
			q.push(MapLoc(nx, ny, nG, nH));
		}
		
	}

	TArray<FVector> ans;
	if (found) {
		int indexGoal = gy * w + gx;
		int indexStart = sy * w + sx;
		ans.Add(FVector(gx,gy,z));
		while (indexGoal != indexStart) {
			int cx = xPointer[indexGoal];
			int cy = yPointer[indexGoal];
			ans.Add(FVector(cx,cy,z));
			indexGoal = cy * w + cx;
		}
	}
	
	return ans;
}

TArray<FVector> UCustomPathfindingLibrary::getFullPath(int sx, int sy, int sz, int gx, int gy, int gz)
{
	globalCost = 1e16;
	float best_cost = 1e16;
	TArray<FVector> best_path;

	if (gz == sz) {
		return getPath(sx, sy, gx, gy, gz);
	}
	for (int i = 0; i < num_lobbies; i++) {

		TArray<FVector> p1 = getPath(lift_lobbies_x[i], lift_lobbies_y[i], gx, gy, gz);
		float current_cost = globalCost;
		if (globalFound) {
			TArray<FVector> p2 = getPath(sx, sy, lift_lobbies_x[i], lift_lobbies_y[i], sz);
			current_cost += globalCost;
			if (current_cost < best_cost) {
				best_cost = current_cost;
				p1 += p2;
				best_path = p1;
			}
		}
	}

	return best_path;
}


